import React from 'react'
import Img from '../assets/ps.jpg'
import Img2 from '../assets/bridge.jpg'
import Img3 from '../assets/building.jpg'

const Card = props => {
    return (
        <div className="card text-center">
            <div className="overflow">
                <img src={Img} alt="img"/>
            </div>
        </div>
    )
}
export default Card


